INSERT INTO `contents` (`no`, `gno`, `depth`, `con_use`, `memu_sort`, `con_sequence`, `con_place`, `con_id`, `con_name`, `con_skin`, `content`, `con_wdate`, `con_ip`, `con_view`) VALUES
(1, 0, 'A', 1, 'main', 1, 'main_top', 'License', 'License', 'pado1_content_skin', '<p>MIT 허가서(영어: MIT License, MIT 라이센스)는 매사추세츠 공과대학교(MIT)을 기원으로 하는 소프트웨어 라이센스 중 가장 대표적인 것이다. X11 License 또는 X License로 표기되기도 한다..<br>&nbsp;<br>MIT 허가서는 미국의 매사추세츠 공과대학교에서 자기 학교의 소프트웨어 공학도들을 돕기 위해 개발한 허가서이다. MIT 허가서를 따르는 소프트웨어를 개조한 제품을 반드시 오픈 소스로 배포해야 한다는 규정이 없으며, GNU 일반 공중 허가서의 엄격함을 피하려는 사용자들에게 인기가 있다. MIT 허가서는 GNU 일반 공중 허가서(GPL)등과 달리 카피 레프트는 아니며, 오픈 소스 여부에 관계없이 재사용을 인정하고 있다. BSD 라이센스를 기초로 작성된 BSD계열 라이센스 중의 하나이다. 여러가지 라이센스 중에서도 MIT 허가서는 매우 제한이 느슨한 라이센스라고 할 수 있다. 이 허가서를 따르는 대표적 소프트웨어로 X 윈도 시스템(X11)이 있다. <br>&nbsp;</p><p>요약하면 MIT 허가서는 다음과 같은 라이센스이다.<br>&nbsp;이 소프트웨어를 누구라도 무상으로 무제한하게 취급해도 좋다. 단, 저작권 표시 및 이 허가 표시를 소프트웨어의 모든 복제물 또는 중요한 부분에 기재해야 한다.<br>&nbsp;저자 또는 저작권자는 소프트웨어에 관해서 아무런 책임을 지지 않는다.</p>', '2013-06-15 07:06:00', '112.161.83.227', 88);
INSERT INTO `manual` (`num`, `gnum`, `depth`, `category`, `wr_user_id`, `nick_name`, `name`, `subject`, `content`, `file1`, `wdate`, `ip`, `bad_count`, `good_count`, `view`, `comments`) VALUES
(1, 1, 'A', '기타', 'admin', '관리자', '류성호', '파도입니다.', '<p>파도 CMS는 웹상에서 기본웹사이트를 일반인이 쉽게 제작할수 있도록 하는게 기본 목표입니다.&nbsp;</p><p>또한 레이아웃과 스킨의 적용으로 프로그래머나 디자이너가 쉽게 디자인과 기능을&nbsp;추가 수정 변경 할수 있도록 만들려고 노력했습니다. 조금 보완할 부분이 있지만 일단 작동할것은 작동 됩니다.</p><p>&nbsp;</p><p>MIT라이센스 입니다.&nbsp;자세한 것은 구글신에게 물어 보세요^^</p><p>(복사, 수정, 배포가능, 상업용으로도 사용할 수 있으나 이로 인해 일어나는 일에 대해 어떠한 책임도 지지 않습니다.)</p><p>&nbsp;</p><p>현재 베타 테스트 중이므로 많은 테스트 부탁해요.</p><p>제가 부족한게 많아서 많이 부족하지만 나름대로 최선을 다해서 만들어 봤습니다.</p><p>&nbsp;</p><p>디자이너가 따로 있을리가 없으므로 제가 디자인적인 요소를 최대한 배제하고 제작했으므로 아름답진 않습니다.</p><p>고로 자바스크립트 프레임워크인 jQuery, bootstrap등을 사용하여 디자이너의 부재를 보완 했습니다.</p><p>덤으로 완벽하진 않지만&nbsp;크로스브라우징과 반응형웹 그리고 html5, css3가 적용되었습니다.</p><p>&nbsp;</p><p>저 혼자 힘으로 더이상 해당 프로젝트를 진행하는것이 힘들다고 판단이 되고 베타 테스트 후에 저와 마음이 맞는분 들과 같이 파도 CMS를 더욱 발전 시켜볼 생각입니다. 뜻이 있는 분들의 많은 참여 바람니다.</p><p>디자이너분도 참여 가능합니다.^^</p><p>&nbsp;</p><p>류성호(꾸숑) <a href="mailto:webse@nate.com">webse@nate.com</a>&nbsp;(네이트온)</p><p>&nbsp;</p><p>&nbsp;</p><p>메인 레이아웃 셈플</p><p>&nbsp;</p><p><img title="1370718433_222.GIF" src="http://file/editor/1370718433_222.GIF"><br both;?=""><br both;?=""></p><p>&nbsp;</p><p>&nbsp;</p>', '', '2013-06-09 04:49:00', '127.0.0.1', 0, 0, 5, 0),
(2, 2, 'A', '업데이트', 'admin', '관리자', '류성호', '파도 CMS 기능정리 입니다.', '<p><strong>파도 CMS 기능정리</strong></p><p>&nbsp;</p><p><strong>레이아웃</strong>-메인레이아웃, 서브레이아웃을 만들고 적용할수 있습니다.</p><p><br><strong>스킨</strong>-게시판스킨, 콘텐츠(HTML)스킨, 회원가입스킨 등을 생성, 적용, 수정 할수 있습니다.</p><p><br><strong>게시판</strong>-게시판 스킨 적용과 각종 옵션으로 여러 형태의 게시판을 자유자제로 생성, 수정 할 수 있습니다. (스킨선택, 다음에디터적용, 스마트에디터적용, 메뉴출력, 새글아이콘출력, 카운터, 쓰기권한, 읽기권한, 답변권한, 댓글권한, 신고, 추천, 분류, 욕필터링, sms연동, 메일연동등...)</p><p><br><strong>회원</strong>-스킨적용, 회원고급검색기능, 회원정보수정, 회원탈퇴, 회원전체메일, 회원가입작동여부선택, 메일인증, 관리자인증, 회원가입축하SMS, 사용제한닉네임, 사용제한아이디, 가입폼선택적적용, 회원탈퇴, 불량회원, 회원케릭터등 적용...</p><p><br><strong>팝업</strong>-원하는 시간과 위치에 원하는 방법으로 팝업생성및 관리</p><p><br><strong>베너</strong>-원하는 위치에 원하는 방법으로 베너 생성및 관리</p><p><br><strong>쪽지</strong>-회원간에 쪽지를 주고 받고 확인할수 있음</p><p><br><strong>메일</strong>-관리자가 회원에게 메일을 발송및 관리</p><p><br><strong>SMS</strong>-관리자가 회원에게 SMS전송및 관리</p><p><br><strong>DB관리</strong>-웹상에서 간단하게 DB를 백업 받고 최적화 할수 있음</p><p><br><strong>웹로그분석</strong>-관리자가 구글웹로그분석 코드를 삽입할수 있음</p><p>&nbsp;</p>', '', '2013-06-15 01:19:00', '112.161.83.227', 0, 0, 5, 0),
(5, 0, 'A', '업데이트', 'admin', '관리자', '류성호', '현재까지 업데이트 내용', '<p>2013.02.24</p><p>게시판 관리자<br>1.스킨 벨류값 적용<br>2.업로드 파일 기본값을 기존값으로 적용<br>3.users테이블 필드 추가(file1, memo)<br>4.관리자 페이지 각종 오류 수정<br>5.설치후 디렉토리 생성 및 디렉토리명 변경 주석처리됨</p><p>&nbsp;</p><p>2013.02.25 작업내용<br>new아이콘(24시간내 작성글)<br>댓글카운터 작동 작업<br>쓰기 읽기 리스트 등 버튼 작업<br>기타 디자인 작업<br>글읽기 (아랫글 윗글 링크 작업)</p><p>&nbsp;</p><p>2013.02.26 작업내용<br>공지사항 리스트 상단 노출(이미지)<br>다음에디터 쓰기 수정 답글에 장착 성공(simple 스킨)</p><p>&nbsp;</p><p>2013.03.02<br>테이블 2개추가 <br>contents - html페이지 생성<br>site_config - 사이트 기본 설정<br>layout적용 site_config에서 설정함<br>기존 board_admin에서 layout설정부분 삭제<br>layout 오류수정및 안정화 작업<br>디렉토리 확장성 고려해서 위치 변경함</p><p>&nbsp;</p><p>2013.03.07<br>메인 상단 이미지 랜덤 출력되도록 작업됨(simple스킨)<br>기존 get_skin_dir()함수를 헬퍼의 directory_map()함수로 모두 교체함<br>좌측 메뉴 css수정-폰트등(sinple스킨)</p><p>&nbsp;</p><p>2013.03.08<br>페이지별 보안 강화 상단 아래 내용 삽입</p><p><br>&lt;?php if (!defined(''BASEPATH'')) exit(''No direct script access allowed'');?&gt;2013.03.12<br>게시판 글읽기-&gt;댓글&nbsp; 케릭터 이미지 삽입 작업완료<br>필드추가 = {id}_comments/co_fileq (댓글작성시의 유저 케릭터명 저장)</p><p>&nbsp;</p><p>2013.03.13<br>베너관리 완성 - 관리자페이지 , 각페이지별 삽입<br>테이블 생성 banner</p><p>&nbsp;</p><p>2013.03.14<br>베너관리/리스트/ 이미지 사이즈 수정및 출력여부 숫자를 문자로 바꿈<br>베너관리/수정/ 업로드한 이미지 사이즈 출력 작업<br>베너관리/수정/ db값 가져와서 출력작업 완료<br>콘텐츠 관리 필드 3개 추가 1개 삭제(테이블명 : content)<br>콘텐츠 관리 / 스킨적용되도록 수정 추가 작업함<br>콘텐츠 관리 / 메뉴 출력 여부지정, 메뉴출력위치 지정 작업완료<br>콘텐츠 관리 / 수정 / db값 가져와서 출력작업 완료<br>레이아웃(simpal) 콘텐츠 페이지 생성메뉴 상단 좌측 하단 적용 성공<br>레이아웃(simpal) css/main/#nav 수정-&gt;마우스오버 색상 변경<br>views/admin 일관성을 위해서 파일명 변경(예 list_view.php-&gt;board_list_view.php)<br>게시판관리/필드3개추가<br>게시판관리/게시판 메뉴출력여부,위치, 순서 지정 작업 완료<br>각종 오류 수정 및 db불필요한 필드 삭제</p><p>&nbsp;</p><p>2013.03.16<br>네이버 스마트 에디터 장착 성공<br>네이버 스마트 에디터에 이미지 업로더 장착 성공<br>루트에 스마트에디터, 다음에디터 디렉토리 정리함<br>스킨 스마트에디터, 다음에디터 작업함<br>기타 디렉토리 정리 파일 정리 오류 수정함<br>콘텐츠 관리 에디터 디렉토리 경로이동으로 인한 오류 수정</p><p>&nbsp;</p><p>2013.03.18<br>관리자/사이트관리(스마트에디터). 콘텐츠관리(스마트에디터), 게시판관리(복수에디터장착)<br>게시판/스마트에디터스킨/버튼작업-&gt;권한별 버튼 출력제어<br>게시판/comment, reply 관련 파일명 변경<br>boar