(4, 3, 'A', '설치매뉴얼', 'admin', '관리자', '류성호', '파도 설치 매뉴얼 입니다.', '<p><span 12pt;?=""><strong>인스톨 기능을 제작 했으나 테스트중 으로 확실한 방법으로 설치 진행합니다.</strong></span>&nbsp;</p><p><span 12pt;?=""><strong>추후 파도가 안정화 된다면 공지하고 매뉴얼을 변경 하겠습니다.</strong>﻿</span>&nbsp;</p><p><span 12pt;?=""><strong></strong></span>&nbsp;</p><p><span 12pt;?=""><strong>1. 파도를 설치하기 위해서 필요한 환경</strong></span><br>운영체제 : 리눅스/유닉스 계열 또는 윈도우즈<br>&nbsp; 웹서버 : Apache<br>&nbsp; PHP : 5.x 이상<br>&nbsp; MYSQL : 5.x 이상</p><p>&nbsp;</p><p><strong><span 12pt;?="">2. 데이터베이스(Mysql) 계정 준비하기</span></strong><br>파도를 설치하기 위해서는 반드시 Mysql 데이터베이스 계정이 셋팅되어 있어야 합니다.<br>&nbsp; 웹호스팅을 이용하는 경우 : 호스팅업체로 부터 받은 Mysql 접속정보를 준비해 둡니다.<br>&nbsp; 로컬서버(PC)에서 설치할 경우 :&nbsp;phpMyAdmin&nbsp;등을 이용해서 파도에서 사용할 DB를 미리 만들어줍니다.<br>미리 알아두어야할 DB정보 : 사용자ID/패스워드/DB네임</p><p>&nbsp;</p><p><strong><span 12pt;?="">3.윈도우즈 서버에서의 설치</span></strong><br>윈도우용APM 패키지를 사용할 경우(윈도우즈용 Apache 웹서버)<br>윈도우용APM 패키지는 Apache + PHP + MYSQL 환경을 한번의 설치로 구성해 줄 수 있는 프로그램입니다.</p><p>&nbsp;</p><p><strong>APM_SETUP</strong><br>APM_SETUP 패키지 다운로드 : <a href="http://www.apmsetup.com/">http://www.apmsetup.com/</a><br>APM_SETUP 을 기본설치할 경우 C:\\APM_Setup 에 설치되며 홈디렉토리는 C:\\APM_Setup\\htdocs 이 됩니다.<br>1.pado.zip 파일을 C:\\APM_Setup\\htdocs 폴더로 옮깁니다.<br>2.pado.zip 파일의 압축을 풀어줍니다.<br>3.pado 폴더생성을 확인 합니다.<br>4.이후 설치 방법은 리눅스 서버에서의 설치 3번부터 진행하면 됩니다.</p><p>&nbsp;</p><p><strong>오토셋</strong><br>오토셋&nbsp;패키지 다운로드 : <a href="http://autoset.net">http://autoset.net</a><br>오토셋을 기본설치할 경우 C:\\AutoSet6 에 설치되며 홈디렉토리는 C:\\AutoSet6\\public_html 이 됩니다.<br>1.pado.zip 파일을 C:\\AutoSet6\\public_html 폴더로 옮깁니다.<br>2.pado.zip 파일의 압축을 풀어줍니다.<br>3.pado 폴더생성을 확인 합니다.<br>4.이후 설치 방법은 리눅스 서버에서의 설치 3번부터 진행하면 됩니다.</p><p>&nbsp;</p><p><strong><span 12pt;?="">4. 리눅스 서버에서의 설치</span></strong><br>1.pado_버젼.tar.gz 파일을 FTP를 이용해서 홈디렉토리(public_html 또는 www등)에 업로드해 줍니다.<br>2.telnet 이나 SSH로 접속하여 pado_버젼.tar.gz 의 압축을 풀어주고 퍼미션을 707로 변경해 줍니다.&nbsp;</p><p>&nbsp; 압축풀기 : tar xvfz pado_버젼.tar.gz&lt;엔터&gt;<br>&nbsp; 퍼미션변경 : chmod -R 707 pado&lt;엔터&gt;<br>3.pado/application/config/databases.php 파일&nbsp; 에서 mysql db 정보를 아래 형태로&nbsp;수정합니다.</p><p>&nbsp; $db[''default''][''hostname''] = ''localhost'';<br>&nbsp; $db[''default''][''username''] = ''pado'';<br>&nbsp; $db[''default''][''password''] = ''1234'';<br>&nbsp; $db[''default''][''database''] = ''pado'';</p><p>4.첨부된 pado.sql 파일을 phpmyadmin등을 이용해서 import 합니다.<br>5.브라우져에서 <a href="http://도메인/pado">http://도메인/pado</a> 를 호출해 줍니다. (윈도우 서버는 <a href="http://localhost/pado">http://localhost/pado</a>&nbsp;)<br>6.관리자아이디: admin 관리자패스워드: 1234<br>&nbsp;&nbsp;위의 정보로 로그인하시고 관리자 패스워드를 변경해 주세요<br>7.설치완료 </p><p><br>※네이버의 스마트에디터 이미지 업로더 기능을 사용하기 위해서는 아래의 사이트를 참조해서 수정해 주세요..<br>&nbsp; <a href="http://blog.naver.com/dualband?Redirect=Log&logNo=90167059028">http://blog.naver.com/dualband?Redirect=Log&amp;logNo=90167059028</a></p>', '', '2013-06-15 01:00:00', '112.161.83.227', 0, 0, 8, 0);
