INSERT INTO `users_config` (`users_no`, `users_enable`, `users_email_activation`, `users_out`, `users_cut_id`, `users_cut_nickname`, `users_skin`, `users_sms_entry`, `users_sms_admin`, `users_sms_message`, `users_register1`, `users_register2`, `users_register3`, `users_register4`, `users_date`) VALUES
(1, 1, 0, 1, 'master|root|admin|help', '마스터|슈퍼관리자|회사대표|', 'pado1_member_skin', 1, '01012345678', '회원가입을 감사드립니다.\n행복한 하루 되세요', '제 1 조 (목적)\n\n 이 서비스 이용약관(이하 “약관”이라 합니다)은 회사(이하 “회사”라 합니다)이 제공하는 서비스(이용고객 또는 회원에게 회사가 제공하는 모든 인터넷서비스를 의미합니다.)와 관련하여, 회사와 이용고객(또는 회원)간에 서비스의 이용조건 및 절차, 회사와 회원간의 권리ㆍ의무 및 책임 사항 기타 필요한 사항을 규정함을 목적으로 합니다. \n\n제 2 조 (용어의 정의)\n\n이 약관에서 사용하는 용어의 정의는 다음 각호와 같으며, 정의되지 않은 용어에 대한 해석은 관계법령 및 서비스별 안내에서 정하는 바에 따릅니다.\n1.회원 : 서비스에 접속하여 이 약관에 동의하고 ID와 비밀번호를 발급 받은 이용고객을 말합니다.\n2.이용고객 : 서비스를 이용하기 위하여 회사와 이용계약을 체결하려고 하는 자를 말합니다.\n3.회원정보 : 성명, 주민등록번호, 연락처 등 회사가 이용고객에게 회원가입 신청양식(이하 “신청양식"이라 합니다)에 기재를 요청하는 이용고객의 개인정보를 말합니다.\n4.ID(고유번호) : 회원의 식별과 회원의 서비스 이용을 위하여 회원이 선정하고 회사가 승인하는 영문자와 숫자의 조합을 말합니다.\n5.비밀번호 : 회원의 회원정보 보호를 위해 회원 자신이 설정한 문자와 숫자의 조합을 말합니다.\n6.포인트 : 회사가 서비스의 원활한 이용을 위하여 회원에게 부여하는 재산적 가치 및 환가성이 없는 무형의 도구를 말합니다.\n7.포스트 : 회원이 회사가 제공하는 서비스에 게시 또는 등록하는 부호(URL 포함), 문자, 음성, 음향, 영상(동영상 포함),이미지(사진 포함), 파일 등을 말합니다.\n\n제3조 (약관의 효력 및 변경)\n1.이 약관은 서비스 화면에 게시하거나 기타의 방법으로 회원에게 공지함으로써 효력이 발생합니다.\n2.회사는 약관의 규제에 관한 법률, 전자상거래등에서의 소비자보호에 관한 법률, 정보통신망 이용촉진 및 정보보호 등에 관한 법률 등 관계법령에 위배되지 않는 범위내에서 이 약관을 개정할 수 있습니다.\n3.회사는 약관을 개정할 경우 그 개정이유 및 적용일자를 명시하여 현행 약관과 함께 적용일자 7일전부터 적용일 전일까지 제1항의 방법으로 공지합니다. 다만, 회원의 권리 또는 의무에 관한 중요한 규정의 변경은 최소한 15일전에 공지하고 개정약관을 회원이 등록한 메일(e-mail)로 발송하여 통지합니다.\n4.회사가 제3항에 따라 개정약관을 공지 또는 통지하면서 회원에게 공지일 또는 통지일로부터 15일내에 거부의사를 표시하지 않으면 의사표시가 표명된 것으로 본다는 뜻을 공지 또는 통지하였음에도 불구하고 회원이 명시적으로 거부의사를 표시하지 아니하는 경우 회원이 개정약관에 동의한 것으로 봅니다.\n5.회원은 변경된 약관에 동의하지 아니하는 경우 서비스의 이용을 중단하고 이용계약을 해지할 수 있습니다. 이때 회사는 회원이 가입한 유료서비스이용기간이 남아 있는 경우 이용계약 해지시점을 기준으로 해당서비스의 환불규정에 따라 환불합니다.\n6.회원은 약관의 변경에 대하여 주의의무를 다하여야 하며, 변경된 약관의 부지로 인한 회원의 피해는 회사가 책임지지 않습니다.\n\n제4조 (약관 외 준칙)\n\n 이 약관에 명시되지 않은 사항에 대해서는 정보통신망 이용촉진 및 정보보호등에 관한 법률, 약관의 규제에 관한 법률, 전기통신사업법 등 관계법령 및 회사가 정한 서비스의 세부이용지침 등의 규정에 따릅니다.\n\n제5조 (이용계약의 성립)\n1.서비스 이용계약은 이용고객이 이 약관 및 “개인정보취급방침"에 “동의합니다"를 선택하고, 회사가 정한 신청양식을 작성하여 서비스의 이용을 신청한 후, 회사가 이를 승낙함으로써 성립합니다.\n2.이용고객이 전항의 "동의합니다"를 선택하고 신청양식을 작성하는 것은 이 약관 및 “개인정보취급방침"의 내용을 숙지하고, 회사가 서비스 이용을 위해 운영하는각종 정책(예 : 저작권 정책, 운영정책 등)과 수시로 공지하는 사항을 준수하는 것에 대해 동의하는 것으로 봅니다.\n\n제6조 (이용신청)\n1.신청양식에 기재하는 회원정보는 이용고객의 실제정보인 것으로 간주되고, 실제정보를 입력하지 않은 회원은 법적인 보호를 받을 수 없으며 서비스 이용에 제한을 받을 수 있습니다.\n2.이용고객은 반드시 본인의 성명 및 주민등록번호 등(이하 "실명"이라 합니다)을 제공하여야 하며, 실명으로 등록하지 않은 회원은 서비스 이용과 관련된 일체의 권리를 주장할 수 없습니다. 회사는 이 경우 부정한 이용신청을 방지하기 위하여 회원인증 및 회원의 실명 여부를 확인하기 위한 절차를 거칠 수 있습니다.\n3.만14세 미만의 아동이 서비스를 이용하기 위해서는 회사가 요구하는 소정의 법정대리인의 동의절차를 거쳐야 합니다.\n4.타인의 명의(성명, 주민등록번호를 말합니다. 이하 같습니다)를 도용하는 등 부정한 목적과 방법으로 이용신청을 한 회원의 ID는사전 통지없이 삭제될 수 있으며, 당해 회원은 주민등록법 등 관계법령에 따라 처벌을 받을 수 있습니다.\n\n제7조 (이용신청에 대한 승낙 및 제한)\n1.회사는 서비스의 이용을 신청한 이용고객에 대하여 업무상ㆍ기술상 지장이 없는 한 접수순서에 따라 서비스의 이용을 승낙합니다.\n2.회사는 다음 각 호에 해당하는 이용신청에 대하여는 승낙을 하지 않을 수 있습니다.\n①기술상 서비스 제공이 불가능한 경우\n②실명이 아니거나, 타인의 명의 사용 등 신청양식을 허위로 기재한 경우\n③신청양식의 기재사항을 누락하거나 오기하여 신청하는 경우\n④사회의 안녕질서 또는 미풍양속을 저해하거나 저해할 목적으로 신청한 경우\n⑤회원의 귀책사유에 의하여 회원자격을 상실한 적이 있는 경우. 다만, 자격상실 이후 6개월 이상 경과한 자로 회사의 회원 재가입 승낙을 받은 경우는예외로 합니다.\n⑥기타 회사가 정한 이용요건에 충족되지 않았을 경우\n\n제8조 (회원정보의 변경)\n\n 회원은 서비스 이용하면서 신청양식에 기재한 회원정보가 변경되었을 경우 지체없이 회원정보를 수정하여야 합니다. 회원정보를 수정하지 않음으로 인하여 발생하는 모든 책임은 회원에게 있습니다.\n\n제9조 (서비스의 이용)\n1.회사는 회원의 이용신청을 승낙한 때부터 서비스를 개시합니다. 다만, 일부 서비스의 경우에는 지정된 일자부터 서비스를 개시합니다.\n2.회사의 업무상ㆍ기술상의 장애로 인하여 서비스를 개시하지 못하는 경우에는 서비스에 공지하거나 회원에게 이를 통지합니다.\n3.서비스의 이용은 연중무휴 1일 24시간을 원칙으로 합니다. 다만, 회사의 업무상ㆍ기술상 또는 서비스 운영정책상 서비스가 일시 중지될 수 있습니다. 이러한 경우 회사는 사전 또는 사후에 이를 공지합니다.\n4.회사는 서비스내의 개별서비스에 대한 별도의 약관을 둘 수 있으며, 개별서비스에서 별도로 적용되는 약관에 대한 동의는 회원이 개별서비스를 최초로 이용할 경우 별도의 동의절차를 거치게 됩니다.\n\n제10조 (서비스의 변경 및 중지)\n1.회사는 서비스(개별서비스 포함)를 변경하여야 하는 상당한 이유가 있는 경우 변경될 서비스의 내용 및 제공일자를 제21조에서 정한 방법으로 회원에게 통지하고 서비스를 변경하여 제공할 수 있습니다.\n2.회사는 회원의 ID와 닉네임이 다음 각 호에 해당되는 경우 회원과 협의하여 회원의 ID와 닉네임을 변경할 수 있습니다. \n①ID가 회원의 전화번호 또는 주민등록번호 등으로 등록되어 사생활 침해가 우려되는 경우 \n②타인에게 혐오감을 주거나 미풍양속에 어긋나는 경우\n③ID가 타회원과 중복되어 서비스 제공이 곤란한 경우\n④기타 합리적인 사유가 있는 경우\n3.회사는 다음 각호에 해당하는 경우 서비스의 전부 또는 일부를 제한하거나 중지할 수 있습니다. \n①서비스용 설비의 보수 등 공사로 인한 부득이한 경우\n②회원이 회사의 영업활동을 방해하는 경우\n③정전, 제반설비의 장애 또는 이용량의 폭주 등으로 정상적인 서비스 이용에 지장이 있는 경우\n④제휴업체와의 계약종료 등과 같은 회사의 제반사정으로 서비스를 유지할 수 없는 경우\n⑤기타 천재지변, 국가비상사태 등 불가항력적 사유가 있는 경우\n4.회사는 만14세 미만 회원, 청소년보호법상의 보호대상인 회원, 만 20세 미만의 회원, 외국인 회원, 법인 회원에 대하여 개별서비스의 이용을 제한할 수있으며, 이러한 서비스 제한에 대한 사항은 개별서비스에서 별도로 공지합니다.\n\n제11조 (컨텐츠 서비스)\n1.회사는 유료컨텐츠 서비스를 제공함에 있어 회사의 정책에 따라 회원에게 유료컨텐츠 서비스의 이용기한을 정할 수 있습니다. 유료컨텐츠 서비스의 이용기한은 각 유료컨텐츠 서비스 세부이용지침에서 정하거나 각 유료컨텐츠 서비스 결제화면 등에 게시하여 회원에게 공지합니다.\n2.회사의 귀책사유로 인하여 회원이 유료컨텐츠 서비스 이용기간동안 컨텐츠 서비스를 제공받을 수 없게 되는 경우, 회사는 유료 컨텐츠서비스 이용잔여기간 동안 이용할 수 있는 동일ㆍ유사한 컨텐츠를 다시 제공하거나 개별 서비스별 환불규정에 따라 보상합니다.\n\n제12조 (개발자계정 서비스)\n1.회원은 회사가 제공하는 개발자계정 서비스를 이용하여 정보통신망 이용촉진 및 정보보호등에 관한 법률 등 관계법령, 이 약관 및 기타 회사의 정책을 위반하는 서비스를 할 수 없습니다.\n2.회원은 선량한 풍속과 사회질서를 해치는 음란, 폭력, 사기 등 청소년에게 유해한 내용을 포함한 서비스를 할수 없습니다.\n3.회원은 정보통신망 이용촉진 및 정보보호등에 관한 법률 및 스팸정책에서 규정한 광고성 메일 전송형식의 기준, 금지행위 등을 준수하여야 합니다.\n4.회사는 회원이 회사의 서비스를 이용하여 웹서비스로 인하여 회사의 시스템 또는 서비스의 기능 저하가 발생하는 경우 합리적인 수단으로 서비스를 제한할 수 있으며, 회원의 서비스 이용을 중지 또는 제한할 수 있습니다.\n5.회원은 회사가 제공하는 서비스를 통하여 저작권 등 제3자의 권리를 침해하여서는 아니 됩니다.\n6.회원은 개발자계정 서비스를 서비스의 목적 범위를 벗어나 이용함으로써 회사의 서버에 부하를 일으켜 정상적인 서비스를 방해하는 등의 행위를 할 수없습니다.\n\n제13조 (유료서비스에 대한 결제 및 청약철회)\n1.회원이 회사가 제공하는 마이큐 또는 컨텐츠 등 유료서비스를 이용하는데 필요한 유료서비스의 이용료 결제, 환불 등에 관한 사항은 "마이큐 이용약관"에 따릅니다.\n2.회사가 제공하는 다운로드방식의 컨텐츠 유료서비스는 전자상거래등에서의 소비자보호에 관한 법률 및 온라인디지털콘텐츠산업발전법에 따라 청약철회가 불가능한 서비스로서 회사는 유료서비스 제공화면 또는 결제화면 등에서 이러한 사항을 별도로 표시합니다.\n\n제14조 (정보의 제공 및 광고의 게재)\n1.회사는 서비스를 운영함에 있어 각종 정보를 서비스 화면에 게재할 수 있습니다.\n2.회사는 서비스의 운영과 관련하여 서비스 화면에 광고 등을 게재할 수 있습니다.\n3.회원이 서비스상에 게재되어 있는 광고를 이용하거나 서비스를 통한 광고주의 판촉활동에 참여하는 등의 방법으로 교신 또는 거래를 하는 것은 전적으로 회원과 광고주간의 문제입니다. 만약, 회원과 광고주간에 문제가 발생할 경우에도 회원과 광고주가 직접 해결하여야 하며, 이와 관련하여 회사는 어떠한 책임도 지지 않습니다.\n\n제15조 (포스트에 대한 책임)\n1.회사는 회원이 게시하거나 전달하는 서비스내의 포스트(게시물)가 다음 각 호의 경우에 해당한다고 판단되는 경우 사전 통지 없이 삭제할 수 있으며, 이에 대해 회사는 어떠한 책임도 지지 않습니다.단, 다음의 경우 회원 탈퇴처리 및 사전통보 없이 포스트를 삭제할 수 있습니다.\n①회사, 다른 회원 또는 제3자를 비방하거나 중상모략으로 명예를 손상시키는 내용인 경우\n②공공질서 및 미풍양속에 위반되는 내용의 포스트에 해당하는 경우\n③범죄적 행위에 결부된다고 인정되는 내용인 경우\n④회사의 저작권, 제3자의 저작권 등 기타 타인의 권리를 침해하는 내용인 경우\n⑤회사가 정한 개별서비스별 세부이용지침에 반하는 내용인 경우\n⑥회사에서 제공하는 서비스와 관련 없는 내용인 경우\n⑦불필요하거나 승인되지 않은 광고, 판촉물을 게재하는 경우\n⑧타인의 ID, 명의 등을 무단으로 도용하여 작성한 내용이거나, 타인이 입력한 정보를 무단으로 위변조한 내용인 경우\n⑨동일한 내용을 중복하여 다수 게시하는 등 게시의 목적에 어긋나는 경우\n⑩기타 관계 법령 및 회사의 개별서비스별 세부이용지침 등에 위반된다고 판단되는 경우\n2.회사는 개별서비스별로 포스트(게시물)와 관련된 세부이용지침을 별도로 정하여 시행할 수 있으며, 회원은 그 지침에 따라 포스트를 게재하여야 합니다.\n3.회사는 킴스보드,킴스온,킴스몰,실크로드와 직접 관련이 없으며, 이와 관련된 불만 및 요청사항이 있을 경우 사전 통지 없이 삭제 할수 있으며, 이에 대해 회사는 어떠한 책임도 지지 않습니다.\n\n제16조 (포스트의 저작권)\n1.회원이 서비스내에 게시한 포스트의 저작권은 저작권법에 의해 보호를 받으며, 회사가 작성한 저작물에 대한 저작권 기타 지적재산권은 회사에 귀속합니다.\n2.회원은 자신이 서비스내에 게시한 포스트를 회사가 국내ㆍ외에서 다음 각 호의 목적으로 사용하는 것을 허락합니다.\n①서비스(제3자가 운영하는 사이트 또는 미디어의 일정 영역내에 입점하여 서비스가 제공되는 경우 포함)내에서 포스트를 사용하기 위하여 포스트의 크기를 변환하거나 단순화하는 등의 방식으로 수정하는 것\n②회사에서 운영하는 다른 사이트에 포스트를 복제ㆍ전송ㆍ전시하는 것. 다만, 회원이 포스트의 복제ㆍ전송ㆍ전시에 동의하지 아니할 경우에는 그러하지 않습니다.\n3.전항의 규정에도 불구하고, 회사가 포스트를 전항 각 호에 기재된 목적 이외에 상업적 목적(예 : 제3자에게 포스트를 제공하고 금전적 대가를 지급받는경우 등)으로 사용할 경우에는 사전에 전화, 메일 등의 방법으로 회원의 동의를 얻습니다. 이 경우 회사는 회원에게 별도의 보상을 제공합니다.\n4.회원이 서비스에 포스트를 게재하는 것은 다른 회원이 포스트를 서비스내에서 사용하거나 회사가 검색결과로 사용하는 것을 허락한 것으로 봅니다. 다만, 회원은 개별서비스내의 관리기능을 통하여 포스트의 비공개 등의 조치를 취할 수 있습니다.\n5.회원이 이용계약을 해지하거나 제23조에 의해 이용계약이 해지되는 경우 회원이 서비스에 게시한 포스트는 자동삭제되지 않습니다. 또한, 다른 회원 또는 제3자에게 의하여 스크랩, 펌, 담기 등으로 다시 게시된 포스트 및 프로젝트, 공유게시판, 댓글 등 공용 서비스내에 게재된 포스트 등 다른 회원의 정상적인 서비스 이용에 필요한 포스트는 삭제되지 않습니다.\n6.회사는 서비스 운영정책상 또는 회사가 운영하는 사이트간의 통합 등을 하는 경우 포스트의 내용을 변경하지 아니하고 포스트의 게재위치를 변경ㆍ이전하거나 사이트간 공유로 하여 서비스할 수 있으며, 포스트의 이전ㆍ변경 또는 공유를 하는 경우에는 사전에 공지합니다.\n\n제17조 (포인트 이용)\n1.회사는 회원에게 포인트를 부여할 수 있으며, 회원은 포인트를 양도, 대여 등 어떠한 처분행위도 할 수 없습니다.\n2.회사는 포인트 획득, 사용방법, 소멸 등에 관한 세부이용지침을 별도로 정하여 시행할 수 있습니다. 회사가 상이한 시기와 발생원인에 따라 회원에게 포인트를 부여하여 회원이 합산된 포인트 중 일부를 사용할 경우 포인트의 차감 순서 또는 소멸시효기간 등은 회사가 결정하여 공지합니다.\n3.회원이 부정한 방법으로 포인트를 획득한 사실이 확인될 경우 회사는 회원의 포인트 회수, ID 삭제 및 형사 고발 등 기타 조치를 취할 수 있습니다.\n\n제18조 (휴면계정 관리)\n1.회사는 장기 비로그인 회원의 개발자계정이 방치됨으로써 발생하는 불필요한 저장공간의 낭비를 줄이고 서비스 이용을 원활히 하기 위해서 휴면계정 관리정책을 실시합니다.\n2.이용고객이 이용신청을 통해서 회원가입 후 서비스를 이용하는 도중 6개월 동안 로그인을 하지 않는 경우, 회사는 회원으로 하여금 서비스의 이용을 제한할 수 있습니다. 이후 6개월 동안(연속하여 12개월 동안) 서비스를 이용하기 위해 로그인을 하지않은 경우 서비스 이용계약이 해지될 수 있으며, 서비스 이용계약이 해지되는 경우에는 회원의 개발자 계정에 보관된 모든 데이터는 삭제 처리됩니다. 이용계약의 해지로 인한 데이터 또는 포스트의 손실에 대한 모든 책임은 회원이 부담합니다.\n\n제19조 (회사의 의무)\n1.회사는 서비스 제공과 관련하여 알고 있는 회원의 회원정보를 본인의 동의없이 제3자에게 제공하지 않습니다. 단, 회사는 귀하의 별도의 동의절차 없이 귀하의 개인정보를 킴스큐 운영위원회와 공유할 수 있습니다\n2.회사는 회원의 회원정보를 보호하기 위해 보안시스템을 구축 운영하며, "개인정보취급방침"을 공지하고 준수합니다. 또한, 회사는 "개인정보취급방침" 따라 회원정보를 취급함에 있어 안정성 확보에 필요한 기술적 및 관리적 대책을 수립ㆍ운영합니다.\n3.회사는 서비스와 관련한 회원의 불만사항이 접수되는 경우 이를 신속하게 처리하여야 하며, 신속한 처리가 곤란한 경우 그 사유와 처리 일정을 서비스 화면에 게재하거나 메일 등을 통하여 회원에게 통지합니다.\n4.회사가 제공하는 서비스로 인하여 회원에게 손해가 발생한 경우 그러한 손해가 회사의 고의나 중과실에 기해 발생한 경우에 한하여 회사에서 책임을 부담하며, 그 책임의 범위는 통상손해에 한합니다.\n\n제20조 (회원의 의무)\n1.회원은 관계법령, 약관, 서비스 이용안내 및 서비스상에 공지한 주의사항, 회사가 서비스 이용과 관련하여 회원에게 통지하는 사항 등을 준수하여야 하며, 기타 회사의 업무에 방해되는 행위를 하여서는 아니 됩니다.\n2.회원은 회사에서 공식적으로 인정한 경우를 제외하고는 서비스를 이용하여 상품을 판매하는 영업 활동을 할 수 없으며, 특히 해킹, 광고를 통한 수익, 음란사이트를 통한 상업행위, 상용소프트웨어 불법배포 등을 할 수 없습니다. 이를 위반하여 발생한 영업 활동의 결과 및 손실, 관계기관에 의한 구속 등 법적 조치 등에 관해서는 회사가 책임을 지지 않으며, 회원은 이와 같은 행위와 관련하여 회사에 대하여 손해배상 의무를 집니다.\n3.회원은 신청양식 기재시 또는 회원정보 변경시 실명으로 모든 사항을 사실에 근거하여 작성하여야 하며, 허위 또는 타인의 명의(또는 정보)를 이용한 사실이 발견된 경우 회원은 서비스 이용과 관련한 일체의 권리를 주장할 수 없습니다.\n4.회원은 서비스의 이용권한, 기타 서비스 이용계약상의 지위를 타인에게 양도, 증여할 수 없으며 이를 담보로 제공할 수 없습니다.\n5.회원은 회원 ID 및 비밀번호를 철저히 관리하여야 하며, 관리소홀, 부정사용 등에 의하여 발생하는 모든 결과에 대한 책임은 회원 본인이 부담하며, 회사는 이에 대한 어떠한 책임도 부담하지 않습니다.\n6.회원은 본인의 ID 및 비밀번호를 제3자에게 이용하게 하여서는 아니되며, 회원 본인의 ID 및 비밀번호를 도난당하거나 제3자가 사용하고 있음을 인지하는 경우에는 즉시 회사에 통지하고 회사가 안내하는 바에 따라야 합니다.\n7.회원은 이용계약을 체결하면서 부여받은 ID를 변경할 수 없으며, 부득이한 사유로 인하여 변경하고자 하는 경우에는 이용계약을 해지하고 재가입하여야 합니다.\n\n제21조 (회원에 대한 통지)\n1.회사는 회원의 서비스 이용에 필요한 권리 및 의무 등에 관한 사항을 회사가 발급한 또는 회원이 지정한 메일, SMS 등으로 통지할 수 있습니다.\n2.회사는 불특정 다수 회원에 대한 통지의 경우 서비스에 게시함으로써 개별 통지에 갈음할 수 있습니다.\n\n제22조 (회원정보의 보호 및 이용)\n1.회사는 적법하고 공정한 수단에 의하여 이용계약의 성립 및 이행에 필요한 최소한의 범위 내에서 "개인정보취급방침"에 따라 이용고객의 회원정보를 수집합니다.\n2.회사의 "개인정보취급방침"은 회사에 링크된 다른 웹사이트(회사가 운영하지 않는 웹사이트를 말합니다. 이하 같습니다)에서는 적용되지 않습니다.\n3.회사는 통신비밀보호법, 정보통신망 이용촉진 및 정보보호 등에 관한 법률 등 관계법령에 따라 행정기관이나 수사기관 등에서 회원의 회원정보의 열람이나 제출을 요청하는 경우에는 이를 제공할 수 있습니다.\n4.회사는 회원의 귀책사유로 인해 노출된 회원정보에 대해서 일체의 책임을 부담하지 않습니다.\n5.회사는 회원정보의 취급 및 관리 등의 업무를 스스로 수행함을 원칙으로 하나, 필요한 경우 이러한 업무의 일부 또는 전부를 회사가 선정한 회사에 위탁할 수 있으며, 회원정보의 취급 및 관리 등에 관한 업무를 위탁하는 경우에는 "개인정보취급방침"에 공지합니다.\n6.회원이 이용계약 체결과정에서 회사에 제공한 회원정보에 대한 이용 또는 제공에 대한 동의를 철회하고자 하는 경우에는 "개인정보취급방침"에서정한 바에 따르며, 회원이 이러한 동의를 철회하는 경우 서비스 이용계약은 자동으로 해지됩니다.\n\n제23조 (계약해지 및 이용제한)\n1.회원이 서비스 이용계약을 해지하고자 할 경우에는 회사가 운영하는 "고객센터" 등에서 해지신청을 하여야 합니다.\n2.회원이 이용계약을 해지하는 경우 제16조 제5항 단서에 따라 포스트가 삭제되지 않을 수 있으므로 이용계약해지 전 삭제하여야 합니다.\n3.회사는 회원이 이 약관 및 개별서비스 이용약관을 위반한 경우 경고, 일시적 이용정지, 영구적 이용정지 등의 단계로 서비스 이용을 제한하거나 이용계약을 해지할 수 있습니다.\n4.회원은 제3항에 따른 서비스 이용정지 기타 서비스 이용과 관련된 이용제한에 대해 회사가 정한 절차에 따라 이의신청을 할 수 있으며, 회사는 회원의 이의신청이 정당하다고 판단되는 경우 즉시 서비스 이용을 재개합니다.\n\n제24조 (손해 배상)\n1.회원이 본 약관의 규정을 위반함으로 인하여 회사에 손해가 발생하게 되는 경우, 이 약관을 위반한 회원은 회사에 발생하는 모든 손해를 배상하여야 합니다.\n2.회원이 서비스를 이용하는 과정에서 행한 불법행위나 이 약관 위반행위로 인하여 회사가 당해 회원 이외의 제3자로부터 손해배상 청구 또는 소송을 비롯한 각종 이의제기를 받는 경우 당해 회원은 자신의 책임과 비용으로 회사를 면책 시켜야 하며, 회사가 면책되지 못한 경우 당해 회원은 그로 인하여 회사에 발생한 모든 손해를 배상하여야 합니다.\n\n제25조 (면책사항)\n1.회사는 천재지변 또는 이에 준하는 불가항력으로 인하여 서비스를 제공할 수 없는 경우에는 서비스 제공에 관한 책임이 면책됩니다.\n2.회사는 회원의 귀책사유로 인한 서비스의 이용장애에 대하여 책임을 지지 않습니다.\n3.회사는 회원이 서비스를 이용하여 기대하는 수익을 상실한 것에 대하여 책임을 지지 않으며 그 밖에 서비스를 통하여 얻은 자료로 인한 손해 등에 대하여도 책임을 지지 않습니다. 회사는 회원이 사이트에 게재한 포스트의 정확성 등 내용에 대하여는 책임을 지지 않습니다.\n4.회사는 회원 상호간 또는 회원과 제3자 상호간에 서비스를 매개로 발생한 분쟁에 대해서는 개입할 의무가 없으며 이로 인한 손해를 배상할 책임도 없습니다.\n\n제26조 (분쟁 조정 및 관할법원)\n1.회원은 포스트와 관련된 저작권 침해, 명예훼손 또는 개인정보 및 서비스 이용과 관련된 사항에 관한 문제제기 또는 문제해결은 회사가 운영하는 고객센터를 통하여 처리하여야 합니다.\n2.서비스 이용과 관련하여 발생한 분쟁에 대한 소송을 제기하는 경우에는 민사소송법상의 법원을 서울중앙지방법원으로 합니다.\n\n\n약관에 정하지 아니한 사항과 이 약관의 해석에 관하여는 관계법령 및 상관례에 따릅니다 개정된 이용약관의 적용일자 이전 가입자 또한 개정된 이용약관의 적용을 받습니다.\n', '회사는 (이하 ''회사''라 합니다.) 이용자의 개인정보를 중요시하며, "정보통신망 이용촉진 및 정보보호 등에 관한 법률" 등 개인정보와 관련된 법령 상의 개인정보보호규정 및 방송통신위원회가 제정한 "개인정보취급방침"을 준수하고 있습니다. 회사는 개인정보취급방침을 통하여 이용자가 제공하는 개인정보가 어떠한 용도와 방식으로 이용되고 있으며, 적극적으로 보호하기 위해 항상 노력하고 있음에 대해 알려드립니다.\n \n제1조. 개인정보의 수집 및 이용 목적\n\n 개인정보는 생존하는 개인에 관한 정보로서 실명, 주민등록번호 등의 사항으로 당사 회원 개인을 식별할 수 있는 정보(당해 정보만으로는 특정 개인을 식별할 수 없더라도 다른 정보와 용이하게 결합하여 식별할 수 있는 것을 포함)를 말합니다. 당사가 수집한 개인정보는 다음의 목적을 위해 활용합니다.\n \n(1) 서비스 제공에 관한 계약 이행 및 서비스 제공에 따른 요금정산\n\n콘텐츠 및 서비스 제공, 물품배송 또는 청구서 등 발송, 본인 인증 및 구매, 요금 결재, 요금추심\n\n(2) 회원관리\n \n회원제 서비스 이용에 따른 본인 확인, 개인식별, 불량회원의 부정 이용 방지와 비인가 사용 방지, 가입 의사 확인, 가입 및 가입횟수 제한, 만14세 미만 아동 개인 정보 수집 시 법정 대리인 동의여부 확인, 추후 법정 대리인 본인확인, 분쟁 조정을 위한 기록보존, 불만처리 등 민원처리, 고지사항 전달\n \n(3) 마케팅 및 광고에 활용\n \n신규 서비스(제품) 개발 및 특화, 인구통계학적 특성에 따른 서비스 제공 및 광고게재, 접속 빈도 파악, 회원의 서비스 이용에 대한 통계, 이벤트 등 광고성 정보 전달 (회원님의 개인정보는 광고를 의뢰한 개인이나 단체에는 제공되지 않습니다.)\n \n제2조. 수집하는 개인정보 항목 및 수집방법\n\n(1) 필수항목\n 1.- 개인회원 : 이름(영문포함), 주민등록번호, 로그인ID, 로그인Password, e-mail주소, 전화번호, 주소\n2.- 개인/법인사업자 : 회사/기관명(영문포함), 사업자등록번호, 로그인ID, 로그인 Password, 대표자명, e-mail주소, 전화번호, 업태, 종목, 기업형태, 사원수, 주소\n3.- 개인회원 14세 미만 : 부모님(법정대리인)의 이름, 주민등록번호, 전화번호 - 해외거주자 : 이름(영문포함), 로그인ID, 로그인Password, e-mail주소, 전화번호, 주소, 본인확인서류\n \n(2) 선택항목\n \n신용카드정보, 은행계좌정보, 이동전화정보 등 대금결제에 필요한 정보 - 알게 된 경로, 관심서비스 , 직업군 \n\n(3) 개인정보 수집방법\n \n- 홈페이지\n\n제3조. 수집한 개인정보의 보유 및 이용기간\n \n회사는 회원가입일로부터 서비스를 제공하는 기간 동안에 한하여 이용자의 개인정보를 보유 및 이용하게 됩니다. 회원 탈퇴를 요청하거나 개인정보의 수집 및 이용에 대한 동의를 철회하는 경우, 수집 및 이용목적이 달성되거나 보유 및 이용기간이 종료한 경우 해당 개인정보를 지체 없이 파기합니다. 단, 다음의 정보에 대해서는 아래의 이유로 명시한 기간 동안 보존합니다.\n 1.ㆍ보존 항목: 이름, 생년월일, 성별, 로그인ID, 전화번호, 주소, 휴대전화번호, 주민등록번호\n 2.ㆍ보존 근거: 서비스 이용의 혼선 방지, 불법적 사용자에 대한 관련 기관 수사협조\n 3.ㆍ보존 기간: 1년\n \n\n그리고 관계법령의 규정에 의하여 보존할 필요가 있는 경우 회사는 아래와 같이 관계법령에서 정한 일정한 기간 동안 회원정보를 보관합니다.\n 1.ㆍ보존 항목: 서비스 이용기록, 접속 로그, 접속 IP 정보\n 2.ㆍ보존 근거: 통신비밀보호법\n 3.ㆍ보존 기간: 3개월\n 4.ㆍ표시/광고에 관한 기록: 6개월 (전자상거래등에서의 소비자보호에 관한 법률)\n 5.ㆍ계약 또는 청약철회 등에 관한 기록: 5년 (전자상거래등에서의 소비자보호에 관한 법률)\n 6.ㆍ대금결제 및 재화 등의 공급에 관한 기록: 5년 (전자상거래등에서의 소비자보호에 관한 법률)\n 7.ㆍ소비자의 불만 또는 분쟁처리에 관한 기록: 3년(전자상거래등에서의 소비자보호에 관한 법률)\n \n제4조. 개인정보의 파기절차 및 방법\n\n당사는 원칙적으로 개인정보 수집 및 이용목적이 달성되거나, 보유 및 이용기간이 경과된 후에는 해당 정보를 지체없이 파기합니다. 파기절차 및 방법은 다음과 같습니다.\n\n(1) 파기절차\n \n회원님이 회원가입 등을 위해 입력하신 정보는 목적이 달성된 후 내부 방침 및 기타 관련 법령에 의한 정보보호 사유에 따라(보유 및 이용기간 참조) 일정 기간 저장된 후 파기되어집니다. 동 개인정보는 법률에 의한 경우가 아니고서는 보유되는 이외의 다른 목적으로 이용되지 않습니다.\n \n(2) 파기방법\n \n종이에 출력된 개인정보는 분쇄기로 분쇄하거나 소각을 통하여 파기하고 전자적 파일형태로 저장된 개인정보는 기록을 재생할 수 없는 기술적 방법을 사용하여 삭제합니다.\n \n제5조. 개인정보의 제공 및 공유\n\n당사는 이용자의 개인정보를 원칙적으로 외부에 제공하지 않습니다. 다만, 아래의 경우에는 예외로 합니다.\n 1.회사는 귀하의 별도의 동의절차 없이 귀하의 개인정보를 킴스큐 운영위원회와 공유할 수 있습니다.\n 2.회사는 귀하의 개인정보를 제휴업체들에게 공개할 수 있으나, 이러한 경우 데이터를 수집하거나 전송하기 전에 명시적으로 귀하에게 알려드릴 것입니다. 또한 귀하의 동의 절차가 사전에 이루어지며, 제휴업체들도 회사의 개인정보보호에 관한 정책을 따르게 됩니다.\n 3.법령의 규정에 의거하거나, 수사 목적으로 법령에 정해진 절차와 방법에 따라 수사기관의 요구가 있는 경우\n \n제6조. 수집한 개인정보의 위탁\n\n회사는 고객서비스 관리 및 민원사항에 대한 처리 등 원활한 업무 수행을 위하여 아래와 같이 개인정보 취급 업무를 위탁하여 운영하고 있습니다. 또한 위탁계약 시 개인정보보호의 안전을 기하기 위하여 개인정보보호 관련 법규의 준수, 개인정보에 관한 제3자 공급 금지 및 사고시의 책임부담 등을 명확히 규정하고 있습니다. 동 업체가 변경될 경우, 변경된 업체 명을 공지사항 내지 개인정보취급방침 화면을 통해 고지 하겠습니다.\n\n\n\n\n\n\n\n\n\n수탁업체\n\n위탁업무 내용\n\n개인정보의 보유 및 이용기간\n\n\n\n\n한국신용평가정보(주)\n\n실명확인/본인확인 서비스\n\n회원탈퇴시 혹은\n 위탁계약 종료시까지\n\n\n\n주식회사 한국사이버결제\n\n신용카드,가상계좌,계좌이체 결제 서비스\n\n\n제7조. 이용자 및 법정대리인의 권리와 그 행사방법\n \n이용자 및 법정 대리인은 언제든지 등록되어 있는 자신 혹은 당해 만 14세 미만 아동의 개인정보를 조회하거나 수정할 수 있으며 가입해지를 요청할 수도 있습니다. 이용자 혹은 만 14세 미만 아동의 개인정보 조회·수정을 위해서는 ‘개인정보변경’(또는 ‘회원정보수정’ 등)을 가입해지(동의철회)를 위해서는 로그인하여 본인 확인 절차를 거치신 후 직접 열람, 정정 또는 탈퇴가 가능합니다. 회원탈퇴방법 : 회원로그인 -> 개인정보 (개인정보 상단의 회원탈퇴 클릭) 혹은 개인정보관리책임자에게 서면, 전화 또는 이메일로 연락하시면 지체 없이 조치하겠습니다. \n\n귀하가 개인정보의 오류에 대한 정정을 요청하신 경우에는 정정을 완료하기 전까지 당해 개인정보를 이용 또는 제공하지 않습니다. 회사는 이용자 혹은 법정 대리인의 요청에 의해 해지 또는 삭제된 개인정보는 “본 사이트에서 수집하는 개인정보의 보유 및 이용기간”에 명시된 바에 따라 처리하고 그 외의 용도로 열람 또는 이용할 수 없도록 처리하고 있습니다.\n \n제8조. 개인정보 자동수집 장치의 설치, 운영 및 그 거부에 관한 사항\n \n본 사이트는 귀하의 정보를 수시로 저장하고 찾아내는 ‘쿠키(cookie)’ 등을 운용합니다. 쿠키란 본 사이트의 웹사이트를 운영하는데 이용되는 서버가 귀하의 브라우저에 보내는 아주 작은 텍스트 파일로서 귀하의 컴퓨터 하드디스크에 저장됩니다. 본 사이트는 다음과 같은 목적을 위해 쿠키를 사용합니다.\n \n▶ 쿠키 등 사용 목적\n 회원으로 등록하면, 처음 로그인할 때 쿠키가 설정되며, 로그아웃하면 삭제됩니다. 회원 로그인과 관련하여 쿠키가 사용되는 것은 현재 로그인 상태인지를 확인하기 위하여 사용되는 것이 일반적입니다. 회원 아이디나 비밀번호를 기억하는 경우도 있지만, 이것은 사용자의 편의를 위한 것으로 사용자들의 이용을 권장할만하지는 않습니다. 특히, 비밀번호의 경우는 외부 유출의 우려가 있으므로 기억시켜서 사용하지 않는 것이 좋습니다.\n회사의 사용자 환경 설정 등에서도 쿠키를 사용합니다. 개인이 직접 선택한 검색 사용환경 값을 저장해 두었다가 사용자가 필요로 하는 환경 설정을 위하여 이 정보를 사용합니다.\n회사는 등록자와 미등록자 사용자들의 사용 빈도의 차이나 반복 사용정도 등 이용자의 이용 행동에 관한 정보를 위하여 쿠키를 사용합니다.\n쿠키는 회사가 진행하는 이벤트 같은 각종 프로모션 행사 등에서 개인 정보를 확인하기 위하여 사용됩니다. 참가자의 참여 빈도수나 이후 당첨 등을 위하여 사용됩니다.\n쿠키는 귀하의 방문 형태 및 총체적인 방문 형태 측정을 위해서도 사용됩니다. 사용자들의 습관이나 이용 방식 등에 대한 정보 수집을 통하여 더욱 나은 서비스를 만들어가는데 기초 자료로 활용합니다. 또한 이런 정보들은 배너 및 프로모션 행사가 사용자에게 필요한 것들로 구성될 수 있도록 하는데 사용되기도 합니다.\n \n▶ 쿠키 설정 거부 방법\n \n예: 쿠키 설정을 거부하는 방법으로는 회원님이 사용하시는 웹 브라우저의 옵션을 선택함으로써 모든 쿠키를 허용하거나 쿠키를 저장할 때마다 확인을 거치거나, 모든 쿠키의 저장을 거부할 수 있습니다.\n \n설정방법 예(인터넷 익스플로어의 경우) : 웹 브라우저 상단의 도구 > 인터넷 옵션 > 개인정보 단, 귀하께서 쿠키 설치를 거부하였을 경우 서비스 제공에 어려움이 있을 수 있습니다.\n \n제9조. 개인정보의 기술적, 관리적 보호 대책\n\n(1) 기술적 대책\n \n회사는 이용자의 개인정보를 취급함에 있어 개인정보가 분실, 도난, 누출, 변조 또는 훼손되지 않도록 안전성 확보를 위해 해킹 등 외부 침입에 대비하여 각 서버마다 침입차단시스템 및 취약점 분석 시스템 등을 이용하여 보안에 만전을 기하고 있습니다.PC방이나 도서관 등과 같은 공공장소에서 컴퓨터를 이용하는 경우에는 특히 개인 정보가 유출되지 않도록 유의하시기 바랍니다. 또한, 게시판이나 메일 주고 받기 등을 통하여 공개되는 개인 정보에 대하여는 회사가 그 보호를 보장하기 어렵습니다. 이렇게 공개되는 정보는 제3자가 수집하여 사용할 수 있음도 염두에 두시기 바랍니다.\n\n(2) 관리적 대책\n \n회사는 이용자의 개인정보에 대한 접근 및 관리에 필요한 절차 등을 마련하고 있으며 개인정보를 처리하는 시스템의 사용자를 지정하여 갱신 등의 관리를 하도록 하고 있으며 직무상 알게된 개인정보를 타인에게 누설하거나 제공하지 않습니다.\n \n또한 이용자의 개인정보를 보호하기 위하여 관련 직원에게 필요한 교육을 실시하고 있고 본 정책에 명시된 이행사항 및 관련 직원의 준수여부를 감사하기 위하여 적절한 절차를 마련하여 운영하고 있습니다. 감사결과 운영상의 시정 또는 개선을 요구하는 사항이나 위반내용이 있는 경우 이를 시정 또는 개선하고 기타 필요한 조치를 취하도록 최선을 다하고 있습니다.\n\n제10조. 개인정보에 관한 민원서비스\n \n회원의 개인정보를 보호하고 개인정보와 관련한 불만을 처리하기 위하여 당사는 개인정보관리책임자를 두고 있습니다. 회원의 개인정보와 관련한 문의사항이 있으시면 아래의 개인정보관리책임자 또는 개인정보관리담당자에게 연락 주시기 바랍니다.\n 1.ㆍ담당부서 : 서비스운영팀\n 2.ㆍ전화번호 : 7777-7777\n 3.ㆍ개인정보 관리책임자 : 관리자\n 4.ㆍE-mail : aaa@aaa.com\n \n기타 개인정보침해에 대한 신고나 상담이 필요하신 경우에는 아래 기관에 문의하시기 바랍니다.\n 1.ㆍ개인분쟁조정위원회 (1336)\n 2.ㆍ정보보호마크인증위원회 (02-580-0533~4)\n 3.ㆍ대검찰청 인터넷범죄수사센터 (02-3480-3600)\n 4.ㆍ경찰청 사이버테러대응센터 (02-392-0330)\n \n제11조. 고지\n\n법령.정책 또는 보안기술의 변경에 따라 내용의 추가.삭제 및 수정이 있을 시에는 변경사항 시행일의 7일전부터 당사 사이트의 공지사항을 통하여 고지합니다.\n\n부칙\n 1.(시행일) 본 개인정보취급방침은 2010년 1월 1일부터 시행합니다.\n 2.(개정일) 본 개인정보취급방침은 2013년 1월 1일부터 개정, 시행합니다\n \n\n\n\n시행일자 : 2013년 1월 1일\n', '0', '0', '2013-06-15 07:06:00');
